DATECNV.text:
/****************************************************************/
/* NAME - DATECNV                                               */
/* RUTINE TO CONVERT FROM HUNDREDTHS SECONDS TO HH:MM:SS        */
/*           2017 - MRS CONSULTING, INC - P.B.A.                */
/****************************************************************/
DATECNV:
ARG  HSTIME
NUMERIC DIGITS 20
STIME =  HSTIME/100
PARSE VAR STIME SEC '.'  HS
HH =  RIGHT(TRUNC(SEC/3600),2,0)
MM =  RIGHT(TRUNC((SEC//3600)/60),2,0)
SS =  RIGHT(TRUNC((SEC//3600)//60),2,0)
RETURN HH || ':' || MM || ':' || SS

HEXTDECR.text:
/****************************************************************/
/* NAME - HEXTDECR                                              */
/* RUTINE TO CONVERT A HEX VALUE TO DECIMAL                     */
/*           2017 - MRS CONSULTING, INC - P.B.A.                */
/****************************************************************/
HEXTDECR:
NUMERIC DIGITS 20
HEX = " "
ARG HEX
HEXN = "HEX = X2D('"||HEX||"'X)"
INTERPRET HEXN
RETURN HEX

PACTDECD.text:
/****************************************************************/
/* NAME - PACTDECR                                              */
/* RUTINE TO CONVERT A LITERAL FROM PACKED TO DEC               */
/*           2017 - MRS CONSULTING, INC - P.B.A.                */
/****************************************************************/
BINTDECR:
NUMERIC DIGITS 20
PACKED = 0
ARG PACKED
PACKED = STRIP(PACKED)
PACN = "PACKED = X2D('"||PACKED||"'X)"
INTERPRET PACN
RETURN PACKED

